import React from 'react';
import logo from './logo.svg';
import './App.css';
import WeatherForecast from './WeatherForecast.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          React Weather Widget
        </h1>
      </header>
      <main>
       <div className="App">
        <WeatherForecast/>
      </div>
      </main>
      <footer>
        Weather Widget
      </footer>
    </div>
  );
}

export default App;
